import React from 'react';
import './comment1.css';
export default function Comment1() {
    return (
        <div>
            <section class="section service" id="services" aria-label="service">
                <div class="container">

                    <p class="section-subtitle text-center">-What We Offer-</p>

                    <h2 class="h2 section-title text-center">Our Creative Services</h2>

                    <p class="section-text text-center">
                        Get the most of reduction in your team’s operating costs for the whole product which creates amazing UI/UX
                        experiences.
                    </p>

                    <ul class="grid-list">

                        <li>
                            <div class="service-card has-after">

                                <figure class="card-icon">
                                    <img src="service-1.png" width="140" height="140" loading="lazy"
                                        alt="UI/UX Creative Design" class="img"/>
                                </figure>

                                <div class="card-content">

                                    <h3 class="h3 card-title">UI/UX Creative Design</h3>

                                    <p class="card-text">
                                        Lorem ipsum dolor sit amet, consectetur adi piscing semper turpis. Nullam eget luctlie gula and
                                        adipiscing elit.
                                    </p>

                                    <a href="#" class="btn-link">
                                        <span class="span">Read More</span>

                                        <ion-icon name="arrow-forward-outline" aria-hidden="true"></ion-icon>
                                    </a>

                                </div>

                            </div>
                        </li>

                        <li>
                            <div class="service-card has-after">

                                <figure class="card-icon">
                                    <img src="service-2.png" width="140" height="140" loading="lazy" alt="App Development"
                                        class="img"/>
                                </figure>

                                <div class="card-content">

                                    <h3 class="h3 card-title">App Development</h3>

                                    <p class="card-text">
                                        Lorem ipsum dolor sit amet, consectetur adi piscing semper turpis. Nullam eget luctlie gula and
                                        adipiscing elit.
                                    </p>

                                    <a href="#" class="btn-link">
                                        <span class="span">Read More</span>

                                        <ion-icon name="arrow-forward-outline" aria-hidden="true"></ion-icon>
                                    </a>

                                </div>

                            </div>
                        </li>

                        <li>
                            <div class="service-card has-after">

                                <figure class="card-icon">
                                    <img src="service-3.png" width="140" height="140" loading="lazy"
                                        alt="Professional Content Writer" class="img"/>
                                </figure>

                                <div class="card-content">

                                    <h3 class="h3 card-title">Professional Content Writer</h3>

                                    <p class="card-text">
                                        Lorem ipsum dolor sit amet, consectetur adi piscing semper turpis. Nullam eget luctlie gula and
                                        adipiscing elit.
                                    </p>

                                    <a href="#" class="btn-link">
                                        <span class="span">Read More</span>

                                        <ion-icon name="arrow-forward-outline" aria-hidden="true"></ion-icon>
                                    </a>

                                </div>

                            </div>
                        </li>

                        <li>
                            <div class="service-card has-after">

                                <figure class="card-icon">
                                    <img src="service-4.png" width="140" height="140" loading="lazy" alt="Graphic Design"
                                        class="img"/>
                                </figure>

                                <div class="card-content">

                                    <h3 class="h3 card-title">Graphic Design</h3>

                                    <p class="card-text">
                                        Lorem ipsum dolor sit amet, consectetur adi piscing semper turpis. Nullam eget luctlie gula and
                                        adipiscing elit.
                                    </p>

                                    <a href="#" class="btn-link">
                                        <span class="span">Read More</span>

                                        <ion-icon name="arrow-forward-outline" aria-hidden="true"></ion-icon>
                                    </a>

                                </div>

                            </div>
                        </li>

                    </ul>

                    <a href="#" class="btn btn-primary">Get Started</a>

                </div>
            </section>

















        </div>

        // <div className='pro' id='pro'>
        //     <h1 className='container' id='fonc'>  
        // <span id='fon2'> Bin</span>_<span id='fon1'>Edk </span>
        // pour client ?
        //    </h1>
        //   <div className="pro-categorie">
        //         <div  id='pro1' className='pro1'>
        //         <Card2
        //             Img={Img1}
        //             detail={"Diagnostiquez votre probléme en ligne"} />
        //         </div>
        //         <div id='pro1' className='pro1'>
        //         <Card2
        //             Img={Img2}
        //             detail={"Validez votre commande en quelques clics"} />
        //         </div>
        //         <div id='pro1' className='pro1'>
        //         <Card2
        //             Img={Img3}
        //             detail={"Le Pro se présente chez vous à l'heure et date prévue"} />
        //         </div>
        //         <div  id='pro1' className='pro1'>
        //         <Card2
        //             Img={Img4}
        //             detail={"Souriez, c'est fait ! Payez et évaluez la prestation !"} />
        //         </div>
        //     </div>
        // </div>
    )
}
